import styled from 'styled-components'

export const NavBar = styled.nav`
  background-color: ${props =>
    props.lightTheme === 'true' ? '#f9f9f9' : ' #0f0f0f'};
  padding: 10px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
`

export const WebsiteLogo = styled.img`
  width: 70px;
`
